zc='DefaultSelectionEventManager$SelectAction',lzc='DefaultSelectionEventManager$SelectAction;',UAc='DefaultUnitConverter',VAc='DelayedRunnable',WAc='DelayedRunnable$1',Nec='Deutsch',exc='DialogBox',kxc='DialogBox$1',ixc='DialogBox$CaptionImpl',jxc='DialogBox$MouseHandler',tqc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",YAc='Dimension',tmc='Dimension [height=',lxc='DirectionalTextHelper',oxc='DockLayoutPanel',pxc='DockLayoutPanel$Direction',qxc='DockLayoutPanel$Direction;',txc='DockLayoutPanel$DockAnimateCommand',rxc='DockLayoutPanel$LayoutData',xtc='DomEvent',Ctc='DomEvent$Type',Gzc='Double',ujc='EAST',sdc='EEE, d MMM yyyy HH:mm:ss Z',ppc='EEE. dd MMM. yyyy HH:mm:ss',sec='EEEE MMMM d',Tec='EEEE, MMMM d',Pec='EEEE, MMMM d, y',oec='EEEE, y MMMM dd',Zac='EM',_gc='EMPTY',ehc='ENABLED',lfc='END',_ac='EX',Uvc='ElementMapperImpl',Vvc='ElementMapperImpl$FreeNode',Oec='English',Ksc='Enum',Fec='Etc/GMT',Hec='Etc/GMT+',Gec='Etc/GMT-',obc='Event type',Myc='Event$NativePreviewEvent',Ptc='EventBus',_rc='EventObject',esc='Exception',$hc='Expecting version 6 from server, got ',jcc='F',ync='F8834F07517EF3B7D02B9E845E5E1B88',Uac='FIXED',wic='FLOAT',dnc='Fail: ',Dcc='Feb',rcc='February',Uqc='Female',Hzc='Float',uxc='FlowPanel',Uwc='FocusWidget',vlc='For input string: "',fdc='Fri',$cc='Friday',Cbc='GET',Gpc='GGD55XLBAH',qrc='GGD55XLBAJ',Dqc='GGD55XLBBI',Fpc='GGD55XLBCH',Fqc='GGD55XLBCI',Cgc='GGD55XLBDB',Epc='GGD55XLBDH',zrc='GGD55XLBDJ',mqc='GGD55XLBDK',cgc='GGD55XLBEB',Cpc='GGD55XLBEH',Eqc='GGD55XLBEI',rrc='GGD55XLBEJ',Dgc='GGD55XLBFB',Jpc='GGD55XLBFH',arc='GGD55XLBFI',Src='GGD55XLBFK',Zqc='GGD55XLBGI',Qrc='GGD55XLBGK',Ggc='GGD55XLBHB',Rpc='GGD55XLBHH',Nqc='GGD55XLBHI',Prc='GGD55XLBHK',Tpc='GGD55XLBIH',Mrc='GGD55XLBIK',Spc='GGD55XLBJH',Ooc='GGD55XLBJJ',Rrc='GGD55XLBJK',cqc='GGD55XLBKG',yqc='GGD55XLBKH',
